import { Provider } from "react-redux";
import UserRedux from "../../components/userRedux/UserRedux";
import { userStore } from "../../components/userRedux/userStore/userStore";


function UserPage(){
    return (
        <>
            <div>
                <Provider store={userStore}>
                    <UserRedux />
                </Provider>
            </div>
        </>
    )
}
export default UserPage;
